CREATE TABLE `players` (
  `player_uid` int NOT NULL AUTO_INCREMENT,
  `full_name` varchar(255) NOT NULL,
  `class_year` int DEFAULT NULL,
  `draft_year` int DEFAULT NULL,
  `current_level` enum('HS','COLLEGE','INTERNATIONAL','G-LEAGUE','NBA') DEFAULT 'NBA',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`player_uid`)
) ENGINE=InnoDB AUTO_INCREMENT=18678 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
